Był młody, który życie wstrzemięźliwie pęǳił;
Był stary, który nigdy nie łajał, nie zrzęǳił;
Był bogacz, który zbiorów potrzebnym uǳielał;
Był autor, co się z cuǳej sławy rozweselał;
Był celnik, który nie kradł; szewc, który nie pĳał;
Żołnierz, co się nie chwalił; łotr, co nie rozbĳał;
Był minister rzetelny, o sobie nie myślał;
Był na koniec poeta, co nigdy nie zmyślał.
— A cóż to jest za bajka? Wszystko to być może!
— Prawda, jednakże ja to mięǳy bajki włożę.
